histogramsToDraw = {
    'ee' : {
        "points" : [["100","2p51"],["100","3p28"],["115","3p29"],["115","2p52"],["130","3p30"]],
        "hists" : {}
    },
    'mm' : {
        "points" : [["100","1p47"],["100","1p13"],["100","1p92"],["100","2p51"], ["130","3p30"]],
        "hists" : {}
    }
}

drawOptions = {
    "vetos" : ["no-veto", "veto"],
    "orth" : ["non-orth", "orth"]
}

comments = {
    "no-veto" : "No High-pT Lepton Veto",
    "veto" : "High-pT Lepton Veto",
    "non-orth" : "Not Orthogonal",
    "orth" : "SOS Orthogonal"
}

#comments = ("#splitline{}{Not Orthogonal}", "#splitline{High-pT Lepton Veto}{Not Orthogonal}", "#splitline{No High-pT Lepton Veto}{SOS Orthogonal}", "#splitline{High-pT Lepton Veto}{SOS Orthogonal}")

histIdx = 1

for lep in histogramsToDraw:
    for point in histogramsToDraw[lep]["points"]:
        for veto in drawOptions["vetos"]:
            for orth in drawOptions["orth"]:
                hist = TH1F(str(histIdx), "", 7, 0, 7)
                hist.Sumw2()
                binIdx = 1
                for CorrJetObs in utils.leptonIsolationList:
                    ptRanges = [""]
                    if CorrJetObs == "CorrJetIso":
                         ptRanges = utils.leptonCorrJetIsoPtRange
                    for ptRange in ptRanges:
                        isoStr = CorrJetObs + str(ptRange)
                        hist.SetBinContent(binIdx, significance[point[0]][point[1]][isoStr][veto][lep][orth])
                        #print binIdx, isoStr
                        hist.GetXaxis().SetBinLabel(binIdx,isoStr)
                        binIdx += 1
                if histogramsToDraw[lep]["hists"].get(veto + orth) is None:
                    histogramsToDraw[lep]["hists"][veto + orth] = []
                histogramsToDraw[lep]["hists"][veto + orth].append(hist)
                histIdx += 1

for lep in histogramsToDraw:
    for veto in drawOptions["vetos"]:
        for orth in drawOptions["orth"]:
            c1 = TCanvas("c1", "c1", 800, 800)

            legend = TLegend(.60,.69,.89,.89)
            legend.SetNColumns(1)
            legend.SetBorderSize(0)
            legend.SetFillStyle(0)

            minimum = None
            maximum = None
        
            hists = histogramsToDraw[lep]["hists"][veto + orth]

            for hist in hists:
                if minimum is None:
                    minimum = hist.GetMinimum()
                else:
                    minimum = min(minimum, hist.GetMinimum())
                if maximum is None:
                    maximum = hist.GetMaximum()
                else:
                    maximum = max(maximum, hist.GetMaximum())

            #def formatHist(hist, cP, alpha=0.35,noFillStyle=False, largeVersion = False):

            histIdx = 0
            for hist in hists:
   
                if histIdx == 0:
                    hist.SetMinimum(minimum-0.1)
                    hist.SetMaximum(maximum+0.1)
                    hist.GetYaxis().SetTitle("Significance")
                    utils.histoStyler(hist)
                    utils.formatHist(hist, utils.signalCp[histIdx], 0, True, True)
                    hist.Draw("l")
                else:
                    utils.formatHist(hist, utils.signalCp[histIdx], 0, True, True)
                    hist.Draw("l same")
    
                legend.AddEntry(hist, "\mu=" + histogramsToDraw[lep]["points"][histIdx][0] + " \Delta_{}M^{0}=" + histogramsToDraw[lep]["points"][histIdx][1].replace('p', '.') + " GeV", 'l')
    
                histIdx += 1

            legend.Draw("same")
            utils.stamp_plot()

            tl = TLatex()
            tl.SetNDC()
            tl.SetTextSize(0.03) 
            tl.SetTextFont(132)
            tl.SetTextAlign(32)
            tl.DrawLatex(.85,.2,"#splitline{" + comments[veto] + "}{#splitline{" + comments[orth] + "}{" + lep + "}}")
            #tl.DrawLatex(.9,.1,"")
            c1.SaveAs(prefix + lep + veto + orth + ".pdf")
    

